        this.DashboardPoSummaryCancelled();
        this.DashboardPoSummaryPartialReceiving();
        this.DashboardPoSummaryPartialReceivingNearlyExpiryApproval();
        this.DashboardPoSummaryPartialReceivingRejectionWH();
        this.getForLabTest();
        this.getForApproval();
