        var date1 = new Date(jquery__WEBPACK_IMPORTED_MODULE_3__('#txtEditReceivingDate').val());
        var date2 = new Date(jquery__WEBPACK_IMPORTED_MODULE_3__('#txtEditexpiration_date').val());
